import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { useEffect, useState } from "react";

function Home(props) {
  const [data, setData] = useState(null);
  var listAds;
  if (data) {
    listAds = data.map((ad) => <li key={ad._id}>{ad.name}</li>);
    console.log(data);
  }
  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);
  return <div>{!data ? "Loading..." : <ul>{listAds}</ul>}</div>;
}

export default Home;
